import { Sky } from '@react-three/drei'

export default function Firmament(props) {
  return (
    <Sky
      turbidity={0}
      distance={600} // Camera distance (default=450000)
      sunPosition={[900000, 3500, 0]} // Sun position normal (defaults to inclination and azimuth if not set)
      inclination={0.4} // Sun elevation angle from 0 to 1 (default=0)
      elevation={0}
      exposure={0}
      mieDirectionalG={0.3}
      rayleigh={0.8}
      azimuth={0} // Sun rotation around the Y axis from 0 to 1 (default=0.25)
      {...props} // All three/examples/jsm/objects/Sky props are valid
    />  )
}
